{"source":{"uri":"features/catalogo.feature","data":"#language: pt\n\nFuncionalidade: Catalogo de cafés\n    Como um usuario do site, seu quero ver o catálogo de cafés na página principal\n    Para que eu possa escolher e saber mais sobre os produtos disponíveis\n\nCenário: Ancessar o catálogo de cafés na página principal\n\n    Quando acesso a página proncipal da Starbugs\n    Então eu quero ver a lista de cafés disoníveis \n\n\nCenário: Iniciar a compra de um café\n\n    Dado que estou na página principal da Starbugs\n        E que desejo comprar o seguinte produto:\n        |name|Expresso Gelado|\n        |price|R$ 9,99|\n        |delivery|R$ 10,00|\n    Quando inicio a compra desse item\n    Então devo ver a página de checkout com os detalhes do croduto\n        E o valor total da compra deve ser de \"R$ 19,99\"  \n      \n\nCenário: Café indisponível      \n\n    Dado que estou na página principal da Starbugs\n        E que desejo comprar o seguinte produto:\n        |name|Expresso Cremoso|\n    Quando inicio a compra desse item\n    Então devo ver um popup informando que o produto está indisponível","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/cupom.feature","data":"#language: pt\n\nFuncionalidade: Uso de Cupons no checkout\n    Como um usuário do site de venda de cafés, Eu quero poder aplicar cupons de desconto na página de checkout, \n    Para que eu possa obter reduções no preço de produtos, aumentando a satisfação com a minha experiência de compra.\n\nContexto: \n\nDado que iniciei a compra do item\n    | name     | Café com Leite|\n    | price    | R$ 19,99      |\n    | delivery | R$ 10,00      |\n    | total    | R$ 29,99      |\n\nCenário: Aplicar Desconto de 20%\n\nQuando aplico o seguinte cupom: \"MEUCAFE\"\nEntão o valor final da compra deve ser atualizado para \"R$ 25,99\"\n\nCenário: Cupom Expirado\n\nQuando aplico o seguinte cupom: \"PROMO20\"\nEntão devo ver a seguinte notificação que o \"Cupom expirado!\"\n    E o valir final da compra deve permanecer o mesmo\n\nCenário: Cupom Inválido\n\nQuando aplico o seguinte cupom: \"PROMO100\"\nEntão devo ver a seguinte notificação que o \"Cupom inválido!\"\n    E o valir final da compra deve permanecer o mesmo\n  \n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/pedido.feature","data":"#language: pt\n\nFuncionalidade: Pedidos\n\n    Como um usuario do starbugs, eu quero selecionar e comprar cafés \n    Para que eu possa receber os produtos em meu endereço e efetuar o pagamento na entrega\n    \n    @smoke\n    Cenário: compra bem sucedida\n\n        Dado que estou na página principal da Starbugs\n            E que inciei a compra do item \"Expresso Tradicional\"\n        Quando faço a busca do seguinte CEP: \"06535110\"\n            E informo os demais dados do endereço:\n                |Numero|56|\n                |Complemento|Apto 99|\n            E escolho a forma de pagamento \"Cartão de Débito\"\n            E por fim finalizo a compra\n        Então sou redirecionado para a página de confirmmação de pedido\n            E deve ser informado um prazo de entrega entre 20 a 30 segundos\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
